import './App.css';
import ReactDOM from 'react-dom/client';
import { createBrowserRouter, RouterProvider } from 'react-router-dom';

const router = createBrowserRouter([{ path: '/', element: <p>Home</p> }]);

function App() {
  return <RouterProvider router={router} />;
}

export default App;
